        public static int ArrayPairSum(int[] nums)
        {
            int add = 0;
            List<int> ans = nums.ToList();
            for (int i = 0; i < nums.Length; i++)
            {
//                foreach (var VARIABLE in ans)
//                {
//                    Console.Write(VARIABLE);
//                    Console.Write("\t");
//                }

                int max = ans[0];
                int trigger = 0;
                for (int j = 0; j < ans.Count; j++)
                {
                    if (ans[j] > max)
                    {
                        max = ans[j];
                        trigger = j;
                    }
                }

//                Console.WriteLine("\\");
//                Console.WriteLine(trigger);

                if ((i % 2) != 0)
                {
//                    Console.WriteLine("time:\t" + (i + 1) / 2 + "\t" + max);
//                    Console.WriteLine(i);
                    add += max;
                }

                ans.RemoveAt(trigger);
//                Console.WriteLine();
            }

            return add;
        }

        //自己的代码是对的，但是效率低下没有过审
        //又是别人家的代码
        //我虽然想到了先排序然后取1，3，5
        //但是我他妈真的不知道居然他妈数组有自带的排序函数！！！
        //真的学到了
        public static int arrayPairSum(int[] nums)
        {
            Array.Sort(nums);
            int result = 0;
            for (int i = 0; i < nums.Length; i += 2)
            {
                result += nums[i];
            }

            return result;
        }
    }
